css:
.node-debugger {
  color: #9da5b4;
  height: 250px;
}
.node-debugger-editor {
  position: relative;
  overflow: auto;
}
.debugger-panel-heading {
  display: flex;
  flex-direction: column;
  justify-content: center;
  height: 33px;
  line-height: 33px;
  flex-basis: 33px;
  vertical-align: middle;
  background-color: #282c34;
  padding: 0 10px;
}
.list-item.heading {
  background-color: #282c34;
}
atom-text-editor::shadow .gutter .line-number.node-debugger-stop-line:before {
  content: ">";
  color: #9da5b4;
}
atom-text-editor::shadow .gutter .line-number.node-debugger-breakpoint {
  background-color: #F00;
}
